import Header from '../../components/Header/Header'
import ListCity from '../../components/ListCity/ListCity'
import './Home.css'

const Home = () => {


	return (
		<div>
			{/* navbar and header */}
			<div className='container-navbar' >
				<div className='container'>
					<NavBar />
					<Header />
				</div>
			</div>

			<div>
				<ListCity />

			</div>
		</div>
	);
};

export default Home;
